import { createRouter, createWebHistory } from 'vue-router';
import MainApp from './components/MainApp.vue';
import AppEtiquetas from './components/AppEtiquetas.vue';
import LoginForm from './components/LoginForm.vue';
import AppTareas from './components/AppTareas.vue';
import SignUpForm from './components/SignUp.vue';
import TareasCompletadas from './components/TareasCompletadas.vue';

const routes = [
    {
      path: '/',
      name: 'MainApp',
      component: MainApp
    },
    {
      path: '/Tareas',
      name: 'Tareas',
      component: AppTareas
    },
    {
      path: '/Etiquetas',
      name: 'Etiquetas',
      component: AppEtiquetas
    },
    {
      path: '/LoginForm',
      name: 'LoginForm',
      component: LoginForm
    },
    {
      path: '/SignUpForm',
      name: 'SignUpForm',
      component: SignUpForm
    },
    {
      path: '/TareasCompletadas',
      name: 'TareasCompletadas',
      component: TareasCompletadas
    }
  ];
  
  const router = createRouter({
    history: createWebHistory(),
    routes
  });

export default router;
